class MaxHeap {
    constructor() {
        this.heap = [];
    }
    size() {
        return this.heap.length;
    }
    getParentIndex(index) {
        return parseInt(index / 2);
    }
    swap(from, to) {
        const store = this.heap[from];
        this.heap[from] = this.heap[to];
        this.heap[to] = store;
    }
    getChildIndexes(index) {
        return {
            left: index * 2 + 1,
            right: index * 2 + 2,
        };
    }
    add(element) {
        this.heap.push(element);
        let currentWorkingIndex = this.heap.length - 1;
        while (this.heap.length > 1) {
            const parentIndex = this.getParentIndex(currentWorkingIndex);
            if (this.heap[parentIndex] < this.heap[currentWorkingIndex]) {
                this.swap(parentIndex, currentWorkingIndex);
                currentWorkingIndex = parentIndex;
                if (parentIndex === 0) {
                    break;
                }
            } else {
                break;
            }
        }
        return;
    }
    remove() {
        const biggestElement = this.heap[0];
        if (this.heap.length === 1) {
            this.heap = [];
            return biggestElement;
        }
        const lastElement = this.heap.pop();
        this.heap[0] = lastElement;
        let currentWorkingIndex = 0;
        while (this.heap.length > 1) {
            const childIndexes = this.getChildIndexes(currentWorkingIndex);
            if (
                this.heap[childIndexes.left] !== undefined &&
                this.heap[childIndexes.right] !== undefined
            ) {
            }
            const biggestIndex =
                this.heap[childIndexes.left] < this.heap[childIndexes.right]
                    ? childIndexes.right
                    : childIndexes.left;
            if (this.heap[biggestIndex] > this.heap[currentWorkingIndex]) {
                this.swap(biggestIndex, currentWorkingIndex);
                currentWorkingIndex = biggestIndex;
                if (currentWorkingIndex === this.heap.length - 1) {
                    break;
                }
            } else {
                break;
            }
        }
        return biggestElement;
    }
    max() {
        return this.heap[0];
    }
}

var minDeletions = function (s) {
    let count = 0;
    const freqObject = {};
    const maxHeap = new MaxHeap();
    for (let index = 0; index < s.length; index++) {
        if (!freqObject[s[index]]) {
            freqObject[s[index]] = 0;
        }
        freqObject[s[index]] += 1;
    }
    for (const key in freqObject) {
        maxHeap.add(Number(freqObject[key]));
    }
    let arr = [];
    let arrIndex = 0;
    let previousRemovedElement = null;
    while (maxHeap.size()) {
        const removedElement = maxHeap.remove();
        if (previousRemovedElement === removedElement) {
            arr.push(removedElement);
        } else if (
            previousRemovedElement !== null &&
            previousRemovedElement - 1 !== removedElement
        ) {
            while (arr[arrIndex] && removedElement < previousRemovedElement - 1) {
                if (previousRemovedElement === 0) {
                    count += arr[arrIndex++];
                } else {
                    const frequencyToBeMade = --previousRemovedElement;
                    count += arr[arrIndex++] - frequencyToBeMade;
                }
            }
        }
        if (previousRemovedElement === null || previousRemovedElement > removedElement) {
            previousRemovedElement = removedElement;
        }
    }

    while (arr[arrIndex]) {
        if (previousRemovedElement === 0) {
            count += arr[arrIndex++];
        } else {
            const frequencyToBeMade = --previousRemovedElement;
            count += arr[arrIndex++] - frequencyToBeMade;
        }
    }
    return count;
};

